import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CatalogueComponent } from './catalogue/catalogue.component';



@NgModule({
  declarations: [
    CatalogueComponent
  ],
  imports: [
    CommonModule
  ]
})
export class CatalogueModule { }
